struct APIResult<T: Decodable>: Decodable {
    var data: T
}

//extenion

extension Data {
    var toImage: UIImage! {
        UIImage(data: self)
    }
}

//func ConvertResponse(

func ConvertPastaResponse(data: AFDataResponse<Data?>) -> APIResult<[Pasta]> {
    defer {
        print("!!!Debugging conervert pasta")
    }
    let dict = try! JSONSerialization.jsonObject(with: data.data!, options: []) as! [String: [Any]]
    return APIResult(data: try! JSONDecoder().decode([Pasta].self, from: try! JSONSerialization.data(withJSONObject: dict["result"]!, options: [])))

}

func ConvertSinglePastaResponse(data: AFDataResponse<Data?>) -> APIResult<Pasta> {
    defer {
        print("!!!Debugging conervert single pasta")
    }
    let dict = try! JSONSerialization.jsonObject(with: data.data!, options: []) as! [String: Any]
    return APIResult(data: try! JSONDecoder().decode(Pasta.self, from: try! JSONSerialization.data(withJSONObject: dict["result"]!, options: [])))

}

